esdocs index="kibana_sample_data_ecommerce" sort="order_date, desc" fields="customer_gender"
| mapColumn "FemaleCount" exp={getCell "customer_gender" | if {compare to="FEMALE"} then=1.2 else=0}
| math "sum(FemaleCount) / count(FemaleCount)"
| revealImage origin="bottom" image={asset "asset-212fba0d-cb5d-4866-a8fa-24338bf39604"} emptyImage={asset "asset-977d547b-fc1e-4b58-96ae-67dc5439611b"}

